import './App.css';
import Main from './main/Main.js'
import { Routes, Route } from "react-router-dom";
import Top from './main/Top';
import Home from './main/Home';

function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<Home />}>
          <Route index element={<Top />} />
        </Route>
      </Routes>
      {/* <Main></Main> */}

    </>

  );
}

export default App;
